// src/pages/ManageUserAccounts.js
import React from 'react';

const ManageUserAccounts = () => {
  return (
    <div className="manage-users">
      <h1>Gestionar Cuentas de Usuario</h1>
      <p>Aquí puedes administrar a los usuarios registrados.</p>
      {/* Aquí puedes listar los usuarios y permitir editar, eliminar, etc. */}
    </div>
  );
};

export default ManageUserAccounts;
